import React, { useState, useEffect } from "react";
import PocketBase from "pocketbase";
import "./VolumeConverter.css";

const pb = new PocketBase("http://127.0.0.1:8090");
pb.autoCancellation(false);

// Format to superscript exponential
const formatExponent = (val) => {
  if (!val || isNaN(val)) return "...";
  const [base, expRaw] = val.toExponential(2).split("e");
  const exp = expRaw.replace("+", "");
  return (
    <>
      {parseFloat(base).toFixed(2)}×10<sup>{exp}</sup>
    </>
  );
};

// Normal + scientific conditional display
const formatNormalSmart = (val) => {
  if (val == null || isNaN(val)) return "...";
  const abs = Math.abs(val);
  return abs < 0.001 || abs >= 1e6
    ? formatExponent(val)
    : Number(val).toLocaleString("en-US", { maximumFractionDigits: 6 });
};

const formatValue = (val, useScientific) =>
  useScientific ? formatExponent(val) : formatNormalSmart(val);

// Real-world card component
const RealWorldBox = ({ selected, setSelected, items, volumeM3, useScientific }) => {
  const sorted = [...items].sort((a, b) => a.scientific_value - b.scientific_value);
  const result =
    selected && volumeM3 && selected.scientific_value
      ? volumeM3 / selected.scientific_value
      : null;

  return (
    <div className="bg-white shadow-md border rounded-lg p-4 flex flex-col gap-3 overflow-hidden max-w-full">
      {/* Converted result */}
      <div className="text-xl font-bold text-blue-600 text-center break-words overflow-x-auto">
        {formatValue(result, useScientific)}
      </div>

      {/* Dropdown */}
      <select
        value={selected?.id || ""}
        onChange={(e) => {
          const item = items.find((obj) => obj.id === e.target.value);
          if (item) setSelected(item);
        }}
        className="border p-2 rounded w-full text-sm"
      >
        {sorted.map((item) => (
          <option key={item.id} value={item.id}>
            {item.name}
          </option>
        ))}
      </select>

      {/* Info block */}
      {selected && (
        <div className="text-sm text-gray-700 bg-gray-50 rounded p-2 border border-gray-200">
          <div className="font-semibold text-center">{selected.name}</div>
          <div className="flex justify-between text-xs mt-1 gap-1">
            <span className="text-blue-600 break-words max-w-[50%]">
              {formatExponent(selected.scientific_value)}
            </span>
            <span className="text-right text-gray-800 break-words max-w-[50%]">
              {formatNormalSmart(selected.approx_value)}{" "}
              {selected.expand?.unit?.symbol || ""}
            </span>
          </div>
          {selected.notes && (
            <div className="text-center text-gray-500 italic mt-2 break-words">
              {selected.notes}
            </div>
          )}
        </div>
      )}
    </div>
  );
};

export default function VolumeConverter() {
  const [units, setUnits] = useState([]);
  const [realItems, setRealItems] = useState([]);
  const [categoryId, setCategoryId] = useState("");
  const [inputValue, setInputValue] = useState("");
  const [fromUnit, setFromUnit] = useState("");
  const [to1, setTo1] = useState("");
  const [to2, setTo2] = useState("");
  const [to3, setTo3] = useState("");
  const [real1, setReal1] = useState(null);
  const [real2, setReal2] = useState(null);
  const [real3, setReal3] = useState(null);
  const [scientific, setScientific] = useState(false);

  useEffect(() => {
    const fetchCategory = async () => {
      const res = await pb.collection("categories").getFullList();
      const volume = res.find((cat) => cat.name === "Volume");
      if (volume) setCategoryId(volume.id);
    };
    fetchCategory();
  }, []);

  useEffect(() => {
    if (categoryId) {
      pb.collection("units")
        .getFullList({ filter: `category = "${categoryId}"` })
        .then(setUnits)
        .catch(console.error);

      pb.collection("realworld_items")
        .getFullList({ filter: `category = "${categoryId}"`, expand: "unit" })
        .then((items) => {
          setRealItems(items);
          setReal1(items[0]);
          setReal2(items[1]);
          setReal3(items[2]);
        })
        .catch(console.error);
    }
  }, [categoryId]);

  const getM3 = () => {
    const from = units.find((u) => u.id === fromUnit);
    return from && inputValue
      ? parseFloat(inputValue) * from.to_base_factor
      : null;
  };

  const convert = (toId) => {
    if (!inputValue || !fromUnit || !toId) return "";
    const from = units.find((u) => u.id === fromUnit);
    const to = units.find((u) => u.id === toId);
    if (!from || !to) return "";
    const result =
      (parseFloat(inputValue) * from.to_base_factor) / to.to_base_factor;
    return formatValue(result, scientific);
  };

  return (
    <div className="max-w-6xl mx-auto px-4 py-6 bg-white rounded-lg shadow">
      {/* Toggle */}
      <div className="flex justify-end mb-4">
        <div className="flex items-center border rounded bg-white shadow-sm">
          <button
            className={`px-4 py-1 rounded-l ${
              !scientific ? "bg-blue-600 text-white" : "bg-white"
            }`}
            onClick={() => setScientific(false)}
          >
            Normal
          </button>
          <button
            className={`px-4 py-1 rounded-r ${
              scientific ? "bg-blue-600 text-white" : "bg-white"
            }`}
            onClick={() => setScientific(true)}
          >
            Scientific
          </button>
        </div>
      </div>

      {/* Input + Conversion */}
      <div className="grid grid-cols-1 md:grid-cols-4 gap-6 items-start">
        {/* Input Panel */}
        <div className="space-y-4 mt-8">
          <h3 className="text-lg font-semibold text-center">From</h3>
          <input
            type="number"
            value={inputValue}
            onChange={(e) => setInputValue(e.target.value)}
            className="border p-2 rounded w-full"
            placeholder="Enter value"
          />
          <select
            value={fromUnit}
            onChange={(e) => setFromUnit(e.target.value)}
            className="border p-2 rounded w-full"
          >
            <option value="">-- Select unit --</option>
            {units.map((u) => (
              <option key={u.id} value={u.id}>
                {u.name} ({u.symbol})
              </option>
            ))}
          </select>
        </div>

        {/* Conversion Boxes */}
        <div className="md:col-span-3 text-center -mt-6">
          <h2 className="text-2xl font-bold mb-4">Conversion</h2>
          <div className="grid grid-cols-1 sm:grid-cols-3 gap-4">
            {[0, 1, 2].map((idx) => {
              const toUnit = idx === 0 ? to1 : idx === 1 ? to2 : to3;
              const setTo = idx === 0 ? setTo1 : idx === 1 ? setTo2 : setTo3;
              return (
                <div key={idx} className="border rounded p-4 bg-white shadow-sm">
                  <div className="text-xl font-bold text-blue-600 mb-2">
                    {convert(toUnit) || "..."}
                  </div>
                  <select
                    value={toUnit}
                    onChange={(e) => setTo(e.target.value)}
                    className="border p-2 rounded w-full text-sm text-center"
                  >
                    <option value="">-- Convert To --</option>
                    {units.map((u) => (
                      <option key={u.id} value={u.id}>
                        {u.name} ({u.symbol}) – {convert(u.id)}
                      </option>
                    ))}
                  </select>
                </div>
              );
            })}
          </div>
        </div>
      </div>

      {/* Real World Comparison Section */}
      {getM3() && (
        <div className="mt-10">
          <h2 className="text-2xl font-bold text-center mb-4">Comparison</h2>
          <div className="grid grid-cols-1 sm:grid-cols-3 gap-6">
            {[real1, real2, real3].map((r, idx) => {
              const setReal = idx === 0 ? setReal1 : idx === 1 ? setReal2 : setReal3;
              return (
                <RealWorldBox
                  key={idx}
                  selected={r}
                  setSelected={setReal}
                  items={realItems}
                  volumeM3={getM3()}
                  useScientific={scientific}
                />
              );
            })}
          </div>
        </div>
      )}
    </div>
  );
}
